import React from 'react';
import {connect} from "react-redux";

const SongDetail = (props) => {

console.log(props);
    if(props.selectSong===null)
        return null;
    else
    return (
        <div className="ui cards">
            <div className="card">
                <div className="content">
                    <div className="fontifyr">{props.selectSong.artist}</div>
                    <div className="meta">{props.selectSong.duration}</div>
                    <div className="description">
                        {props.selectSong.title}
                    </div>
                </div>
            </div>
        </div>)
};

const mapStateToProps = state => {
    //console.log(state); //what does connect does to this function
    return {
        selectSong: state.SongSelected,
    };
};

export default connect(mapStateToProps)(SongDetail);
